style.css:
@-moz-document url-prefix("https://electrotransport.ru") {
body, .content-wrapper, #content_section {
	background-image: url(https://i.ibb.co/pj8qXsX/Blue-Plasma.gif), url(https://i.ibb.co/D5m7TVW/h-1523207183-7762604-160eb1d963.jpg);
    background-repeat: no-repeat;
    background-attachment:fixed;
    background-color: #000 !important;
    background-position: 100% 100%, center;
    background-size: 1280px, 100%;
    background-blend-mode: screen;
}
body, td, th, tr, .list_posts, .windowbg.description {
    color: #0099ff!important
}
.kpr_opinion, .kpr_rating_post, #forumposts .signature, .floatleft, .postgroup, .blurb, .custom, .karma, .hscroll, #pollquestion, #forumposts .signature, .post .signature, .flow_hidden, .keyinfo h5, #forumposts .modified, .button, html input[type="button"], input[type="reset"], input[type="submit"], .user-tag-my {
    color: #00ffff!important
}
a:link, a:visited, a:active, .inner, #preview_body, .middletext, .content, .spoiler-body {
	color: #0099ff !important;
}
a:hover, .navPages {
    color: #00ffff !important;
    box-shadow: 0 0 50px #00beff;
    border-radius: 5px !important;
}
::-webkit-scrollbar {
    background: -webkit-linear-gradient(40deg , #000000 , #002D45 , #000000 100%)!important;
    width: 5px !important;
}
::-webkit-scrollbar-thumb {
    background: -webkit-linear-gradient(10deg , #000000 , #0099ff , #000000 100%)!important;
    border-radius: 100px!important;
    border: 0px!important;
}
::-webkit-scrollbar-thumb:hover {
    cursor: pointer !important;
    background: -webkit-linear-gradient(10deg , #075981 , #0099ff , #075981 100%)!important;
    border: 1px solid #0099ff !important;
}
.new-linktree, div.quick_nav, table.table_list tbody.header td div.cat_bar, .switch-theme, .titlebg, .windowbg2, .catbg, tr.message-bg td, p#whoisviewing, .date_post, .plainbox, .buttonlistOldStyle, .spoiler-head.closed, .spoiler-head.open, .profile-bar, #other_ads>a, .information {
background: url('data:image/png;base64,') no-repeat !important;
    background-size: 100% !important;
    color: #00ffff !important;
}
table.table_list td, table.table_list th, .header-main, .lightgreenline, table.table_list td, table.table_list th, .header-main, .lightgreenline, h3.catbg, div.cat_bar, div.title_barIC, div.title_barIC h4.titlebg, .sidebar-toggle, .input_text, select, .button_submit, .main_menu ul, .main_menu li a span, .main_menu li.active a span em, .topic_table .icon1, .topic_table .icon2, .topic_table .stats, .navPages, .titlebg2.clearfix, .table_list .section-header td, .table_grid .section-header th, .table_grid .section-header a, .topic_table td.stickybg2, .author.stickybg.hidden-xs, .author.windowbg.hidden-xs, .description, .windowbg, .windowbg2, textarea, .buttonlistOldStyle ul li a span, .reset.clearfix, .spoiler-wrap, .input_password, .input_file, #preview_body, ul.profile-tabs li a, .author.lockedbg.hidden-xs, #content {
    background: none repeat scroll 0 0 rgba(0, 7, 27, 0.7) !important;
	border: 1px solid #003366 !important;
    border-left: 1px solid #003366 !important;
	box-shadow: 0 0 30px #0099ff;
	padding: 5px !important;
	border-radius: 10px !important;
	-webkit-border-radius: 10px !important;
	-moz-border-radius: 10px !important;
	-khtml-border-radius: 10px !important;
}
blockquote.bbc_standard_quote, .bbc_alternate_quote, .button, html input[type="button"], input[type="reset"], input[type="submit"] {
    background: none repeat scroll 0 0 rgba(0, 7, 27, 0.7) !important;
	border: 1px solid #0099ff !important;
    border-left: 1px solid #0099ff !important;
	box-shadow: 0 0 20px #00ffff;
	padding: 5px !important;
	border-radius: 10px !important;
	-webkit-border-radius: 10px !important;
	-moz-border-radius: 10px !important;
	-khtml-border-radius: 10px !important;
}
#footer_section, .roundframe, .spoiler-body {
	background-color: transparent !important;
}
.fa-navicon:before, .fa-reorder:before, .fa-bars:before {
background: url('data:image/png;base64,') no-repeat !important;  
    height: 18px !important;
	padding-right: 18px !important;
	width: 0 !important;
}
.centertext, table.table_grid thead tr.catbg th, .new_posts, .topic_table td.stickybg2 {
background: url('data:image/png;base64,') center no-repeat !important;  
    background-size: 100% !important;
    border: 1px solid #003366 !important;
    border-left: 1px solid #003366 !important;
    box-shadow: 0 0 50px #00144C; 
}
.topic_table td.locked_sticky2, .topic_table td.lockedbg2 {
background: url('data:image/png;base64,') center no-repeat !important;  
    background-size: 100% !important;
    border: 1px solid #003366 !important;
    border-left: 1px solid #003366 !important;
    box-shadow: 0 0 50px #00144C; 
}
img[alt="*"] {
	background: url('data:image/png;base64,') !important;
	height: 12px !important;
	padding-right: 12px !important;
	width: 0 !important;
    }
}
